import ReactPlayer from 'react-player'
import {Header} from '../Header'
import './contact.css'
export const Contact= () => {
    return (
        <div className='contact-bg-container'>
            <Header />
            <h1>Contact</h1>
            <ReactPlayer  playing  loop playsinline muted width='100vw' height='100vh' url='https://www.betterup.com/hubfs/coaches.mp4' />
        </div>
    );
}
